import './App.css';

function App() {
  return (
    <div className="wrapper">
      <div className="form-wraper">
        <h1>Loan Calculator</h1>
        <form onSubmit={this.handleDubmit} noValidate></form>
      </div>
    </div>
  );
}

export default App;
